import { ApiAuth } from '../../api/index';
import { initStart, initSuccess, initError, initErrorTest } from './appActions';
import { userOperations } from '../user';

export function init() {
  return async function initFlow(dispatch: any) {
    try {
      dispatch(initStart());
      ApiAuth.init();
        await dispatch(userOperations.getUser());

      dispatch(initSuccess());

    } catch (err) {
      dispatch(initError());
    }
  };
}
